  "Sanction Details" : "WITHOUT ADMITTING OR DENYING THE FINDINGS HEREIN, RESPONDENT CONSENT TO THE ENTRY OF THIS ORDER INSTITUTING ADMINISTRATIVE AND CEASE-AND-DESIST PROCEEDINGS, MAKING FINDINGS, AND IMPOSING REMEDIAL SANCTIONS AND A CEASE-AND-DESIST ORDER PURSUANT TO SECTION 8A OF THE SECURITIES ACT OF 1933, SECTION 15(B) OF THE SECURITIES EXCHANGE ACT OF 1934, SECTIONS 203(E) AND 203(F) OF THE INVESTMENT ADVISERS ACT OF 1940, AND SECTIONS 9(B) AND 9(F) OF THE INVESTMENT COMPANY ACT OF 1940 (\"ORDER\"): RESPONDENT DUNHAM CEASE AND DESIST FROM CAUSING ANY VIOLATIONS AND ANY FUTURE VIOLATIONS OF SECTION 7(A) OF THE INVESTMENT COMPANY ACT; RESPONDENT CEASE AND DESIST FROM COMMITTING OR CAUSING ANY VIOLATIONS AND ANY FUTURE VIOLATIONS OF SECTIONS 5(A) AND 5(C) OF THE SECURITIES ACT; RESPONDENTS DUNHAM BE, AND HEREBY IS, CENSURED; RESPONDENT DUNHAM SHALL, WITHIN 10 DAYS OF THE ENTRY OF THIS ORDER, PAY A CIVIL MONEY PENALTY IN THE AMOUNT OF $50,000.",
  "Broker Comment" : "DUNHAM SETTLED AN INFORMAL INQUIRY WITH THE SEC ABOUT DUNHAM'S PRIVATE FUNDS. SINCE 1985, DUNHAM HAS USED ITS OWN PRIVATE FUNDS WHICH FOCUSED ON PERFORMANCE FEE INVESTING. DUNHAM AGREED TO SETTLE WITHOUT ADMITTING OR DENYING ALLEGATIONS. DUNHAM FILED FOR AND OPENED PUBLIC FUNDS IN 2004. THERE WERE NEVER ANY INVESTOR COMPLAINTS OF LOST MONEY, LACK OF LIQUIDITY, HARM, OR IMPROPER VALUATIONS. THIS WAS COST FREE AND TAX FREE TO INVESTORS."
